        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("MatrixSolveLs") 
                    begin  
                        begin  
                            v25791 = convert(TensorFlow.Tensor{Any}, v25791) 
                            begin  
                            end
                        end
                        begin  
                            v25792 = convert(TensorFlow.Tensor{Any}, v25792) 
                            begin  
                            end
                        end
                        begin  
                            v25793 = convert(TensorFlow.Tensor{Float64}, v25793) 
                            begin  
                            end
                        end
                        begin  
                            (v25791, v25792) = tf.tf_promote(v25791, v25792)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v25791)
                        end
                        begin  
                            tf.add_input(desc, v25792)
                        end
                        begin  
                            tf.add_input(desc, v25793)
                        end
                    end 
                    begin  
