        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("QuantizeV2") 
                    begin  
                        begin  
                            v26050 = convert(TensorFlow.Tensor{Float32}, v26050) 
                            begin  
                            end
                        end
                        begin  
                            v26051 = convert(TensorFlow.Tensor{Float32}, v26051) 
                            begin  
                            end
                        end
                        begin  
                            v26052 = convert(TensorFlow.Tensor{Float32}, v26052) 
                            begin  
                            end
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v26050)
                        end
                        begin  
                            tf.add_input(desc, v26051)
                        end
                        begin  
                            tf.add_input(desc, v26052)
                        end
                    end 
                    begin  
                        begin  
