        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("DynamicStitch") 
                    begin  
                        begin  
                            v26315 = convert.(TensorFlow.Tensor{Int32}, v26315) 
                            begin  
                            end
                        end
                        begin  
                            v26316 = convert.(TensorFlow.Tensor{Any}, v26316) 
                            begin  
                            end
                        end
                        begin  
                            (v26316,) = tf.tf_promote(v26316)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v26315)
                        end
                        begin  
                            tf.add_input(desc, v26316)
                        end
                    end 
                    begin  
                        begin  
                            if N !== nothing 
                                desc["N"] = Base.Int(N)
                            end
                        end
                    end
                end), name, "DynamicStitch") 
        tf.Tensor(tf.Operation(desc))
    end

