"""
     matrix_diag_part(input)

Returns the batched diagonal part of a batched tensor.

This operation returns a tensor with the `diagonal` part
of the batched `input`. The `diagonal` part is computed as follows:

Assume `input` has `k` dimensions `[I, J, K, ..., M, N]`, then the output is a
tensor of rank `k - 1` with dimensions `[I, J, K, ..., min(M, N)]` where:

`diagonal[i, j, k, ..., n] = input[i, j, k, ..., n, n]`.

The input must be at least a matrix.

For example:

```prettyprint
# 'input' is [[[1, 0, 0, 0]
               [0, 2, 0, 0]
               [0, 0, 3, 0]
               [0, 0, 0, 4]],
              [[5, 0, 0, 0]
               [0, 6, 0, 0]
               [0, 0, 7, 0]
               [0, 0, 0, 8]]]

and input.shape = (2, 4, 4)

tf.matrix_diag_part(input) ==> [[1, 2, 3, 4], [5, 6, 7, 8]]

which has shape (2, 4)
```
"""
tf.@op function matrix_diag_part(v26357; name=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("MatrixDiagPart") 
                    begin  
                        begin  
                            v26357 = convert(TensorFlow.Tensor{Any}, v26357) 
                            begin  
                            end
                        end
                        begin  
                            (v26357,) = tf.tf_promote(v26357)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v26357)
                        end
                    end 
                    begin  
                    end
                end), name, "MatrixDiagPart") 
        tf.Tensor(tf.Operation(desc))
    end

