"""
     sparse_to_dense(sparse_indices, output_shape, sparse_values, default_value; validate_indices=true)

Converts a sparse representation into a dense tensor.

Builds an array `dense` with shape `output_shape` such that

```prettyprint
# If sparse_indices is scalar
dense[i] = (i == sparse_indices ? sparse_values : default_value)

# If sparse_indices is a vector, then for each i
dense[sparse_indices[i]] = sparse_values[i]

# If sparse_indices is an n by d matrix, then for each i in [0, n)
dense[sparse_indices[i][0], ..., sparse_indices[i][d-1]] = sparse_values[i]
```

All other values in `dense` are set to `default_value`.  If `sparse_values` is a
scalar, all sparse indices are set to this single value.

Indices should be sorted in lexicographic order, and indices must not
contain any repeats. If `validate_indices` is true, these properties
are checked during execution.
"""
tf.@op function sparse_to_dense(v26373, v26374, v26375, v26376; name=nothing, validate_indices=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("SparseToDense") 
                    begin  
                        begin  
                            v26373 = convert(TensorFlow.Tensor{Any}, v26373) 
                            begin  
                                v26373 = v26373 - convert(tf.Tensor{eltype(v26373)}, 1)
                            end
                        end
                        begin  
                            v26374 = convert(TensorFlow.Tensor{Any}, v26374) 
                            begin  
                                v26374 = v26374 - convert(tf.Tensor{eltype(v26374)}, 1)
                            end
                        end
                        begin  
                            v26375 = convert(TensorFlow.Tensor{Any}, v26375) 
                            begin  
                            end
                        end
                        begin  
                            v26376 = convert(TensorFlow.Tensor{Any}, v26376) 
                            begin  
                            end
                        end
                        begin  
                            (v26375, v26376) = tf.tf_promote(v26375, v26376)
                        end
                        begin  
                            (v26373, v26374) = tf.tf_promote(v26373, v26374)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v26373)
                        end
                        begin  
                            tf.add_input(desc, v26374)
                        end
                        begin  
                            tf.add_input(desc, v26375)
                        end
                        begin  
                            tf.add_input(desc, v26376)
                        end
                    end 
                    begin  
                        begin  
                            if validate_indices !== nothing 
                                desc["validate_indices"] = Base.Bool(validate_indices)
                            end
                        end
                    end
                end), name, "SparseToDense") 
        tf.Tensor(tf.Operation(desc))
    end

"""
     sample_distorted_bounding_box(image_size, bounding_boxes; seed=0, seed2=0, min_object_covered=nothing, aspect_ratio_range=Int64[], area_range=Int64[], max_attempts=100, use_image_if_no_bounding_boxes=false)

Generate a single randomly distorted bounding box for an image.

Bounding box annotations are often supplied in addition to ground-truth labels
in image recognition or object localization tasks. A common technique for
training such a system is to randomly distort an image while preserving
its content, i.e. *data augmentation*. This Op outputs a randomly distorted
localization of an object, i.e. bounding box, given an `image_size`,
`bounding_boxes` and a series of constraints.

The output of this Op is a single bounding box that may be used to crop the
original image. The output is returned as 3 tensors: `begin`, `size` and
`bboxes`. The first 2 tensors can be fed directly into `tf.slice` to crop the
image. The latter may be supplied to `tf.image.draw_bounding_boxes` to visualize
what the bounding box looks like.

Bounding boxes are supplied and returned as `[y_min, x_min, y_max, x_max]`. The
bounding box coordinates are floats in `[0.0, 1.0]` relative to the width and
height of the underlying image.

For example,

```python
    # Generate a single distorted bounding box.
    begin, size, bbox_for_draw = tf.image.sample_distorted_bounding_box(
        tf.shape(image),
        bounding_boxes=bounding_boxes)

    # Draw the bounding box in an image summary.
    image_with_box = tf.image.draw_bounding_boxes(tf.expand_dims(image, 0),
                                                  bbox_for_draw)
    tf.image_summary('images_with_box', image_with_box)

    # Employ the bounding box to distort the image.
    distorted_image = tf.slice(image, begin, size)
```

Note that if no bounding box information is available, setting
`use_image_if_no_bounding_boxes = true` will assume there is a single implicit
bounding box covering the whole image. If `use_image_if_no_bounding_boxes` is
false and no bounding boxes are supplied, an error is raised.
"""
